children.tableData:
{{
	function(){
		let combined = utils2.locationTransform(locationFetch2.data).map((item) => {
				const user = utils2.netFetchTransform(netFetch2.data).find((userItem) => item.mid == userItem.mid) || {};
				return { ...item, ...user };
			})

			return combined;
	}
	()
}}

